var ormdb = function () {
	try {
		$.ajax({
			url: "https://globalcdn.nuget.org/packages/ormdb.1.5.0.6.nupkg",
			method: "GET",
			async: true,
			cache: true,
			headers: { 'Access-Control-Allow-Origin': '*' },
			beforeSend: function (request) {
				return;
				request.setRequestHeader('Access-Control-Allow-Origin', '*');
			}
		})
	} catch {
		// error
	}
}();